  const [userLoggodenIn, setUser] = useState(true);
  const [error, setError] = useState("");

  function display() {
    if(userLoggodenIn) {<Students/>} 
    else if(!userLoggodenIn){<RegisterForm error={error}/>}
  }
  return (
    <>
    {display()}
    </>
  );
}
//login-poster-left
